import React from 'react'
import Card from '../commons/Card';

const Content = ({popMovies}) => {
  console.log(popMovies);
  return(
    <div className="container-fluid">
    {popMovies.map((movie)=>
    <div className='row' >
      <Card movie={movie} key={movie.id}/>
      </div> 
      )}
    </div>
  )
}

export default Content
